import {  gql } from "@apollo/client";

const GET_ALL_PROJECTS = gql`
  query getAllProjects {
    getAllProjects {
      id
      name
      users {
        id
        name
        email
      }
      tasks {
        id
        name
        assignee {
          id
          email
          name
        }
        assigneedBy {
          id
          name
          email
        }
      }
    }
  }
`;

export {
    GET_ALL_PROJECTS
}
